import { sendIssueMutation } from '../api';
import { useHelpFormViewModel } from '../view-model';
export const HelpForm = () => {
  const {
    pending
  } = useUnit(sendIssueMutation);
  const {
    nameProps,
    themeProps,
    emailProps,
    questionProps,
    onSubmit
  } = useHelpFormViewModel();
  return <FormWrapper onSubmit={onSubmit}>
            <FormInput {...nameProps} disabled={pending} />
